var lrz    = require('lrz');
var expect = chai.expect;

describe("测试压缩正常运作", function () {

    it("基本例子:传入路径", function () {
        return lrz('base/test/img/transparent_png.png')
            .then(function (rst) {
                expect(rst).to.all.keys('formData', 'origin', 'base64', 'fileLen', 'base64Len', 'file');
            });
    });

    it("基本例子:传入base64", function () {
        var base64 = 'data:image/png;base64,';

        return lrz(base64)
            .then(function (rst) {
                expect(rst).to.all.keys('formData', 'origin', 'base64', 'fileLen', 'base64Len', 'file');
            });
    });
});